import React, {useState} from 'react';
import CachipunContainer from './CachipunContainer';

export default function CachipunEvaluation(props) {

    const [gameCounter, setGameCounter] = useState(0)

    const gameCounterHandler = (e) => {
        setGameCounter(e.target.value)
    }

  return (
    <div>
        {props.gameCounter <= 5 && <CachipunContainer onAddGameCounter={gameCounterHandler} />}
        {props.gameCounter > 5 && <h2>Se acabo el juego</h2>}
    </div>
  );
}
